import React, { Component } from "react";
import { NavLink } from "react-router-dom";
import "./Navbar.css";

class Navbar extends Component {
  render() {
    return (
      <div className='Navbar'>
        <NavLink exact activeClassName='Navbar-active' to='/projects' className="custom-underline">
            Projects
        </NavLink>
        <NavLink exact activeClassName='Navbar-active' to='/education'>
            Education
        </NavLink>
        <NavLink exact activeClassName='Navbar-active' to='/about'>
            About
        </NavLink>
        <NavLink exact activeClassName='Navbar-active' to='/contact'>
            Contact
        </NavLink>
      </div>
    );
  }
}
export default Navbar;
